import React, { Component } from 'react'

export default class NewBeer extends Component {
  render() {
    return (
      <div>
        <form onSubmit={() => console.log("submitting")}>
          <input type="text" name="name" placeholder="name" onChange={this.handleChange}/> <br/>
          <input type="text" name="tagline" placeholder="tagline" onChange={this.handleChange}/> <br/>
          <input type="text" name="description" placeholder="description" onChange={this.handleChange}/> <br/>
          <input type="text" name="firstBrewed" placeholder="firstBrewed" onChange={this.handleChange}/> <br/>
          <input type="text" name="brewerTips" placeholder="brewerTips" onChange={this.handleChange}/> <br/>
          <input type="number" name="attenuationLevel" placeholder="attenuationLevel" onChange={this.handleChange}/> <br/>
          <input type="text" name="constributedBy" placeholder="constributedBy" onChange={this.handleChange}/> <br/>
          <input type="submit"/> <br/>
        </form>
      </div>
    )
  }
}
